import React from 'react';
import GroupMember from './GroupMember';
import { Card } from 'reactstrap';
import CustomCollapse from "./CustomCollapse";
interface IProps{
    membersArrayPreventingDuplicateDisplayMember: any;
    toggleCollapse2: any;
    isOpen2: any;
    isAdmin: any,
    defaultAvatar: any;
}

const MembersOnSideBar : React.FC<IProps> = ({ isAdmin, defaultAvatar, membersArrayPreventingDuplicateDisplayMember, toggleCollapse2, isOpen2 }) => {

    return <Card className="mb-1 shadow-none border">
    <CustomCollapse
      title={`Members (${membersArrayPreventingDuplicateDisplayMember?.length})`}
      iconClass="ri-group-line"
      isOpen={isOpen2}
      toggleCollapse={toggleCollapse2}
    >
      {membersArrayPreventingDuplicateDisplayMember?.map((member: any) => (
        <GroupMember defaultAvatar={defaultAvatar} isAdmin={isAdmin} member={member}/>
      ))}
    </CustomCollapse>
  </Card>
}

export default MembersOnSideBar;
